import React, { useContext, useEffect } from "react";
import { observer } from "mobx-react";

import EditIcon from "@material-ui/icons/Edit";
import AddIcon from "@material-ui/icons/Add";
import SpeedDial, { SpeedDialProps } from '@material-ui/lab/SpeedDial';
import SpeedDialIcon from '@material-ui/lab/SpeedDialIcon';
import SpeedDialAction from '@material-ui/lab/SpeedDialAction';
import { Button, List, ListItem, ListItemText } from "@material-ui/core";

import { StoreTechnologiesContext } from "../../../store/technology";
import SectionComponent from "../Section";

const Technologies: React.FC = observer(() => {
  const technologiesStore = useContext(StoreTechnologiesContext);
  const { technologies, fetch, add } = technologiesStore;

  useEffect(() => {
    fetch();
  }, [fetch]);

  const actions = [
    { icon: <AddIcon />, name: "Add" },
    { icon: <EditIcon />, name: "Edit" },
  ];

  const [open, setOpen] = React.useState(false);
  const [hidden, setHidden] = React.useState(false);

  const handleDirectionChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setDirection((event.target as HTMLInputElement).value as SpeedDialProps['direction']);
  };

  const handleHiddenChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setHidden(event.target.checked);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleOpen = () => {
    setOpen(true);
  };

  return (
    <SectionComponent title={"Technologies"}>
      <List>
        {technologies.map((tech) => (
          <ListItem key={tech.id}>
            <ListItemText primary={tech.name} />
          </ListItem>
        ))}
      </List>
      <Button variant="contained" color="primary" onClick={add}>
        ADD
      </Button>

      <SpeedDial
          ariaLabel="SpeedDial example"
          className={classes.speedDial}
          hidden={hidden}
          icon={<SpeedDialIcon />}
          onClose={handleClose}
          onOpen={handleOpen}
          open={open}
          direction={direction}
        >

{actions.map((action) => (
            <SpeedDialAction
              key={action.name}
              icon={action.icon}
              tooltipTitle={action.name}
              onClick={handleClose}
            />
          ))}
        </SpeedDial>
    </SectionComponent>
  );
});

export default Technologies;
